🙏"Цели и желания существуют во мне, как и в других. Так их и принимая, позволь им преобразится"❤
Как правило у нас есть разные стандарты: одни стандарты для себя, другие для всех остальных. Мы оправдываем себя и осуждаем других. Такой ум, с разными стандартами всегда прибывает в несчастье. Этот ум не справедлив и пока это происходит мы не сможем иметь представление об истине. Давайте попробуем осознать, что Цели и Желания существуют "ВО МНЕ", так же как и в "ДРУГИХ"...Если мы думаем, что мы исключение, то знайте, что это именно то, что думает каждый заурядный ум. Знание о том, что мы обыкновенные, и есть самое не обыкновенное в этом мире. Никто не особенный! Религиозный ум знает, что все одинаковы, так что, если мы оправдываем свои действия, то точно так же должны оправдывать и других. Если критикуем других, то так же эта критика применима к нам самим. Не нужно создавать двух разных подходов. Единый подход полностью преобразует нас, мы впервые сможем посмотреть непосредственно на реальность, принять её такой какая она есть. Не осуждайте других. Не осуждающий ум несёт сострадание. Он обладает глубокой степенью приятия. Тогда весь мир становится отражением нас самих. Он становится зеркалом. Мы начинаем в каждом лице видеть самого себя🙏❤#kundaliniyoga#kundaliniteachers#myfriends#meditation#moscow#limassol#cyprus#love#interestingfacts#inlove#fun#healthystile#compassion#practice#womenpractice#yogalife#yogacyprus#sunrice#sussex#mountain#aboutcyprus#welcomecyprus#";}i:160;a:1:{s:14:"comments_count";i:0;}i:161;a:1:{s:11:"likes_count";i:1;}i:162;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuURW8nnwc";}i:163;a:1:{s:5:"image";s:248:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118796970_357981728939381_7182606821443699243_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=ZibB4702t38AX-xH6PI&_nc_tp=18&oh=7f37b5640fb259d5a8b4f74bd9cfa206&oe=5F7BC0FA";}i:164;a:1:{s:4:"type";s:5:"image";}i:165;a:1:{s:8:"owner_id";i:7471905022;}i:166;a:1:{s:14:"owner_username";s:0:"";}i:167;a:1:{s:14:"owner_fullname";s:0:"";}i:168;a:1:{s:9:"owner_pic";s:0:"